import React from 'react';
import Head from 'next/head';
import { Row, Col } from 'antd';
import AppLayout from '../components/AppLayout';

const Rank = () => (
  <>
    <Head>
      <title>Study Board | Rank</title>
    </Head>
    <AppLayout>
      <>
        <Row gutter={[24, 24]}>
          <Col span={12} />s
          <Col span={12} />

          <Col span={12} />s
          <Col span={12} />
        </Row>
        <Row gutter={[24, 24]}>
          <Col span={12} />s
          <Col span={12} />
        </Row>
      </>

    </AppLayout>
  </>
);

export default Rank;
